import React from 'react';
import './App.css';
import Clarifai from 'Clarifai';
import Navbar from './components/navbar/Navbar';
import Logo from './components/logo/Logo';
import Rank from './components/rank/Rank'
import Particles from "react-tsparticles";
import ImageLinkForm from './components/ImageLinkForm/ImageLinkForm'
import { loadFull } from "tsparticles";
const particlesInit = async (main) => {
  await loadFull(main);
};
const particlesLoaded = (container) => {
  // console.log(container);
};

class App extends React.Component{
  constructor(){
    super()
    this.state ={
      input : ''
    }
  }

  onSearchChange= (event) =>{
    console.log(event.target.value)
  }

  onButtonClick =() =>{
    const onButtonSubmit = () => {
     let app = new Clarifai.App({
       apiKey: '8821cc9a7a764a11a48e02afbce265fd',
     });

     app.models
       .predict(
         Clarifai.FACE_DETECT_MODEL,
         // THE JPG
         "https://i.insider.com/5d321d4ea209d3146d650b4a?width=1100&format=jpeg&auto=webp"
       )
       .then((response) => {
         console.log(response);
       })
       .catch((err) => {
         console.log(err);
       });
   };
  }
  render(){
     return (
      <div className="App">
        <Particles
          className="particles"
          id="tsparticles"
          init={particlesInit}
          loaded={particlesLoaded}
          options={{
            background: {
              color: {
                value: "none",
              },
            },
            fpsLimit: 120,
            interactivity: {
              events: {
                onClick: {
                  enable: true,
                  mode: "push",
                },
                onHover: {
                  enable: true,
                  mode: "repulse",
                },
                resize: true,
              },
              modes: {
                push: {
                  quantity: 4,
                },
                repulse: {
                  distance: 200,
                  duration: 0.4,
                },
              },
            },
            particles: {
              color: {
                value: "#ffffff",
              },
              links: {
                color: "#ffffff",
                distance: 150,
                enable: true,
                opacity: 0.5,
                width: 1,
              },
              collisions: {
                enable: false,
              },
              move: {
                direction: "left",
                enable: true,
                outModes: {
                  default: "bounce",
                },
                random: false,
                speed: 3,
                straight: false,
              },
              number: {
                density: {
                  enable: true,
                  area: 700,
                },
                value: 50,
              },
              opacity: {
                value: 0.4,
              },
              shape: {
                type: "circle",
              },
              size: {
                value: { min: 1, max: 5 },
              },
            },
            detectRetina: true,
          }}
        />

         <Navbar/>
         <Logo/>
         <Rank/>
         <ImageLinkForm
         onSearchChange = {this.onSearchChange}
         onButtonClick = {this.onButtonClick} />
         {/*<FaceRecogination/>*/}
      </div>
    );
   }
  }

export default App;
